import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import { BrowserRouter } from "react-router-dom";
import { Provider } from "unstated";
import { createStore, subscribe, dispatch, combineReducers } from "redux";
import Check from "./redux/Check";

const prodductReducer = function(state, action) {
  return state;
};
const userReducer = function(state, action) {
  return state;
};

const allReducers = combineReducers({
  products: prodductReducer,
  user: userReducers
});

const store = createStore(
  allReducers,
  { products: [{ name: "IPHONE" }], user: "MICHEALS" },
  window.devToolsExtension && window.devToolsExtension
);

console.log(store.getStore());

ReactDOM.render(<Provider store={store} />, document.getElementById("root"));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
